public class Print5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
           int no=1;
           int i=2;
           while (i<=10)
           {
        	   if(no<=9)
        	   {
        		   System.out.print(no+" ");
            	   no=no+2;  
        	   }
        	   else if(i<=10)
        	   {
        		   System.out.print(i+" ");
              	 i=i+2;
        	   }
           }
	}
}
